This one is quite straightforward: you no longer need to write extern crate to import a crate into your project. Before: // Rust 2015 extern crate futures; mod submodule { use futures::Future;
} After: // Rust 2018 mod submodule { use futures::Future;
} Now, to add a new crate to your project, you can add it to your Cargo.toml, and then there is no step two. If you're not using Cargo, you already had to pass --extern flags to give rustc the location of external crates, so you'd just keep doing what you were doing there as well. One small note here: cargo fix will not currently automate this change. We may have it do this for you in the future. An exception There's one exception to this rule, and that's the "sysroot" crates. These are the crates distributed with Rust itself. Usually these are only needed in very specialized situations. Starting in 1.41, rustc accepts the --extern=CRATE_NAME flag which automatically adds the given crate name in a way similar to extern crate. Build tools may use this to inject sysroot crates into the crate's prelude. Cargo does not have a general way to express this, though it uses it for proc_macro crates. Some examples of needing to explicitly import sysroot crates are: std : Usually this is not neccesary, because std is automatically imported unless the crate is marked with #![no_std] . core : Usually this is not necessary, because core is automatically imported, unless the crate is marked with #![no_core] . For example, some of the internal crates used by the standard library itself need this. proc_macro : This is automatically imported by Cargo if it is a proc-macro crate starting in 1.42. extern crate proc_macro; would be needed if you want to support older releases, or if using another build tool that does not pass the appropriate --extern flags to rustc. alloc : Items in the alloc crate are usually accessed via re-exports in the std crate. If you are working with a no_std crate that supports allocation, then you may need to explicitly import alloc. test : This is only available on the nightly channel , and is usually only used for the unstable benchmark support. Macros One other use for extern crate was to import macros; that's no longer needed. Macros may be imported with use like any other item. For example, the following use of extern crate: #[macro_use]
extern crate bar; fn main() { baz!();
} Can be changed to something like the following: use bar::baz; fn main() { baz!();
} Renaming crates If you've been using as to rename your crate like this: extern crate futures as f; use f::Future; then removing the extern crate line on its own won't work. You'll need to do this: use futures as f; use self::f::Future; This change will need to happen in any module that uses f.

